import org.apache.poi.ss.usermodel.Workbook;
import org.apache.poi.ss.usermodel.WorkbookFactory;

import java.util.ArrayList;
import java.util.Collections;
import java.util.List;

public class MagneticFieldData {

    private String location;
    private float latitude;
    private float longitude;
    private double magneticFieldIntensity;

    public MagneticFieldData(String location, float latitude, float longitude, double magneticFieldIntensity) {
        this.location = location;
        this.latitude = latitude;
        this.longitude = longitude;
        this.magneticFieldIntensity = magneticFieldIntensity;
    }

    public String getLocation() {
        return location;
    }

    public float getLatitude() {
        return latitude;
    }

    public float getLongitude() {
        public double getMagneticFieldIntensity() {
        return magneticFieldIntensity;
    }

    public static void main(String[] args) {

        try {
            Workbook workbook = WorkbookFactory.create(new java.io.FileInputStream("magneticFieldData.xlsx"));
            org.apache.poi.ss.usermodel.Sheet sheet = workbook.getSheetAt(0);
            int rowCount = sheet.getLastRowNum() + 1;
            List<MagneticFieldData> magneticFieldDataList = new ArrayList<>();

            for (int I = 0; I < rowCount; i++) {
                MagneticFieldData magneticFieldData = new MagneticFieldData(sheet.getRow(i).getCell(0).toString(),
                        Float.parseFloat(sheet.getRow(i).getCell(1).toString()),
                        Float.parseFloat(sheet.getRow(i).getCell(2).toString()),
                        Double.parseDouble(sheet.getRow(i).getCell(3).toString()));
                magneticFieldDataList.add(magneticFieldData);
            }

            Collections.sort(magneticFieldDataList, (o1, o2) -> o2.getMagneticFieldIntensity() < o1.getMagneticFieldIntensity() ? -1 : 1);

            double sum = 0;
            for (int I = 0; I < magneticFieldDataList.size(); i++) {
                sum += magneticFieldDataList.get(i).getMagneticFieldIntensity();
            }

            double average = sum / magneticFieldDataList.size();
            double sd = Math.sqrt(Collections.sum(magneticFieldDataList.stream().map(o -> Math.pow(o.getMagneticFieldIntensity() - average, 2)).toList()) / (magneticFieldDataList.size() - 1));

            System.out.println("Average magnetic field intensity: " + average);
            System.out.println("Standard deviation: " + sd);

            JFreeChart chart = ChartFactory.createLineChart("Magnetic Field Intensity vs. Location", "Location", "Magnetic Field Intensity (Tesla)", magneticFieldDataList, "Location");
            chart.getLegend().setVisible(true);

            chart.setBackgroundPaint(Color.white);
            chart.getTitle().setFont(new Font("Arial", Font.BOLD, 18));
            chart.getLegend().setFont(new Font("Arial", Font.PLAIN, 14));
            chart.getPlot().setBackgroundPaint(Color.lightGray);
            chart.getPlot().setOutlinePaint(Color.darkGray);

            ChartPanel chartPanel = new ChartPanel(chart);
            chartPanel.setPreferredSize(new java.awt.Dimension(700, 500));
            JFrame frame = new JFrame("Magnetic Field Data ");
            frame.setContentPane(chartPanel);
            frame.pack();
            frame.setVisible(true);
            frame.setDefaultCloseOperation(JFrame.EXIT_ON_CLOSE);

        } catch (Exception e) {
            e.printStackTrace();
        }
    }
}

This code reads the data from the "magneticFieldData.xlsx" spreadsheet using Apache POI library, sorts it based on the magnetic field intensity, calculates the average and the standard deviation, and creates a line chart using JFreeChart library. The chart displays the magnetic field intensity data for each location and shows the location names as a legend.

