// LDPC encoder module for FPGA implementation

module ldpc_encoder(
    input clk,
    input rst,
    input [N-1:0] message,
    input [N-1:0] parity_check,
    output [N-1:0] encoded_message
);

parameter N = 4; // length of message
parameter M = N*N; // number of bits in parity_check
parameter V = 1; // number of iterations

reg [N-1:0] s;
reg [N-1:0] c;
reg [N-1:0] p;

assign encoded_message = p;

always @(posedge clk or posedge rst)
    if (rst)
        s <= message;
    else
        s <= m_to_s(message, parity_check);

always @(s)
    case (V)
        1'b0: p <= s;
        1'b1: p <= c;
        default: p <= s^c;
    endcase
endmodule

// module to transform message into s

module m_to_s(
    input [N-1:0] message,
    input [N-1:0] parity_check,
    output [N-1:0] s
);

// s is the message concatenated with its parity bits
assign s = message;

// set the parity bits in s
for (int I = 0; I < M; i++)
    if (parity_check[i/N] >> (i%N) == 1'b1)
        s[i] = s[i] ^ message[i/N];
endmodule

// module to decode the error correction code

module ldpc_decoder(
    input clk,
    input rst,
    input [N-1:0] encoded_message,
    input [N-1:0] parity_check,
    output [N-1:0] message
);

parameter N = 4; // length of message
parameter M = N*N; // number of bits in parity_check
parameter I = 2; // number of iterations

reg [N-1:0] s;
reg [N-1:0] c;
reg [N-1:0] p;

assign message = s;

always @(posedge clk or posedge rst)
    if (rst)
        s <= encoded_message;
    else
        s <= d_to_s(encoded_message, parity_check);

always @(s)
    case (I)
        1'b0: p <= s;
        1'b1: p <= c;
        default: p <= s^c;
    endcase
endmodule

// module to transform encoded message into s

module d_to_s(
    input [N-1:0] encoded_message,
    input [N-1:0] parity_check,
    output [N-1:0] s
);

// s is the encoded message with its parity bits
assign s = encoded_message;

// set the parity bits in s
for (int I = 0; I < M; i++)
    if (parity_check[i/N] >> (i%N) == 1'b1)
        s[i] = s[i] ^ encoded_message[i/N];
endmodule

// module to check the error correction code

module ldpc_checker(
    input clk,
    input rst,
    input [N-1:0] message,
    input [N-1:0] parity_check,
    output error
);

parameter N = 4; // length of message
parameter M = N*N; // number of bits in parity_check

reg [N-1:0] s;
reg [N-1:0] c;
reg [N-1:0] p;

assign error = 1'b1;

always @(posedge clk or posedge rst)
    if (rst)
        s <= message;
    else
        s <= m_to_s(message, parity_check);

always @(s)
    case (V)
        1'b0: c <= s;
        1'b1: c <= p;
        default: c <= s^p;
    endcase

always @(c)
    if (c != message)
        error <= 1'b1;
    else
        error <= 1'b0;
endmodule

// module to transform message into s

module m_to_s(
    input [N-1:0] message,
    input [N-1:0] parity_check,
    output [N-1:0] s
);

// s is the message concatenated with its parity bits
assign s = message;

// set the parity bits in s
for (int I = 0; I < M; i++)
    if (parity_check[i/N] >> (i%N) == 1'b1)
        s[i] = s[i] ^ message[i/N];
endmodule
